    "    \n",
    "    # 딥러닝 모델 입력 형식에 맞게 변환\n",
    "    blob = cv2.dnn.blobFromImage(face_img, scalefactor=1.0, size=(227, 227), mean=(78.4263377603, 87.7689143744, 114.895847746), swapRB=False)\n",
